                        "context": "<p><strong style=\"color: rgb(51, 51, 51);\">Read the following passage and answer the question that follows.</strong></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">More people signed up for Harvard’s online courses in a year, for example, than have attended the university in its 377 years of existence. In the same spirit, there are more unique visits each month to the WebMD network, a collection of health websites, than to all the doctors working in the United States. In the legal world, three times as many disagreements each year amongst eBay traders are resolved using ‘online dispute resolution’ than there are lawsuits filed in the entire US court system. On its sixth birthday, the Huffington Post had more unique monthly visitors than the website of the New York Times, which is almost 164 years of age. The British tax authorities use a fraud-detection system that holds more data than the British Library (which has copies of every book ever published in the UK). In 2014, the US tax authorities received electronic tax returns from almost 48 million people who had used online tax preparation software rather than a tax professional to help them. The architectural firm Gramazio &amp; Kohler used a group of autonomous flying robots to assemble a structure out of 1500 bricks. The consulting firm Accenture has 750 hospital nurses on its staff, while Deloitte, founded as an audit practice 170 years ago, now has over 200,000 professionals and its own full-scale corporate university set in a 700,000-square-foot campus in Texas.</span></p>",
