                        "question_type": 1,
                        "context": "<p><strong style=\"color: rgb(51, 51, 51);\">Read the poem and answer the TWO questions that follow.</strong></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">The slow person you left behind when, finally,</span></p><p><span style=\"color: rgb(51, 51, 51);\">you mastered the world, and scaled the heights you now command,</span></p><p><span style=\"color: rgb(51, 51, 51);\">where is he while you</span></p><p><span style=\"color: rgb(51, 51, 51);\">walked around the shaved lawn in your plus fours,</span></p><p><span style=\"color: rgb(51, 51, 51);\">organizing with an electric clipboard</span></p><p><span style=\"color: rgb(51, 51, 51);\">your big push to tomorrow?</span></p><p><span style=\"color: rgb(51, 51, 51);\">Oh, I have come across him, yes, I have, more than once,</span></p><p><span style=\"color: rgb(51, 51, 51);\">coaxing his battered grocery cart down the freeway meridian,</span></p><p><span style=\"color: rgb(51, 51, 51);\">Others see in you sundry mythic types distinguished</span></p><p><span style=\"color: rgb(51, 51, 51);\">not just in themselves but by the stories</span></p><p><span style=\"color: rgb(51, 51, 51);\">we put in with beginnings, ends, surprises:</span></p><p><span style=\"color: rgb(51, 51, 51);\">the baby Oedipus on the hillside with his broken feet</span></p><p><span style=\"color: rgb(51, 51, 51);\">or the dog whose barking saves the grandmother</span></p><p><span style=\"color: rgb(51, 51, 51);\">flailing in the millpond beyond the weir,</span></p><p><span style=\"color: rgb(51, 51, 51);\">dragged down by her woolen skirt.</span></p><p><span style=\"color: rgb(51, 51, 51);\">He doesn’t see you as a story, though.</span></p><p><span style=\"color: rgb(51, 51, 51);\">He feels you as his atmosphere. When your sun shines,</span></p><p><span style=\"color: rgb(51, 51, 51);\">he chorteles. When your barometric pressure drops</span></p><p><span style=\"color: rgb(51, 51, 51);\">and the thunder heads gather,</span></p><p><span style=\"color: rgb(51, 51, 51);\">he huddles under the overpass and writes me long letters with</span></p><p><span style=\"color: rgb(51, 51, 51);\">the study little pencil he steals from the public library.</span></p><p><span style=\"color: rgb(51, 51, 51);\">He asks me to look out for you.</span></p>",
