                        "context": "<p><strong style=\"color: rgb(51, 51, 51);\">Read the following scenario and answer the THREE questions that follow.</strong></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">During the floods of 2018-2019, a group of philanthropists led by Niyabuddin, wished to open free food centre for the needy. Their motto was that “no human should be hungry.” Nothing gives more satisfaction to the philanthropists than to see the hungry eat to the fullest.</span></p><p><span style=\"color: rgb(51, 51, 51);\">Post Covid-19, the group started a food centre by the name Win Borne Life Care Food (WBLCF) in a small town called Palakkad. The centre started gaining popularity as the number of people enjoying free meals increased over time. Initially, WBLCF offered a standardized menu consisting of idli, upma, puttu for breakfast, curd rice for lunch, and idli or upma for supper. Six women were employed by WBLCF to prepare all the meals. As the number of diners increased, they started expecting a variety in the menu.</span></p><p><span style=\"color: rgb(51, 51, 51);\">At WBLCF, not all the diners eat \"free\": while two-thirds of diners get free food, one-third would donate some amount to a transparent charity box kept at the entrance. For example, a man donated Rs. 500 after consuming two idlis, and a woman approached Niyabuddin and inquired about donating 10 kilogrammes of rice. Those who could not afford to donate, were often seen prostrating worshipfully in front of the charity box.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Some caring individuals made monetary donation while others donated rice, fruits and vegetables to WBLCF. Further, the centre received enquiries from many locals on how they could contribute to the cause.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">As the centre was lauded for its philanthropic work by people of the town, Niyabuddin intended to replicate the initiative in the nearby districts. However, he is concerned about the cost that goes into running the centre. Almost 75 percent of the donated amount goes into buying the cooking ingredients, while the rest goes into paying salaries, operations and maintenance costs.</span></p>",
