                        "question_type": 1,
                        "context": "<p><strong style=\"color: rgb(51, 51, 51);\">Read the following scenario and answer the THREE questions that follow.</strong></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Bharat Business School (BBS), a premier business school, was renowned for the quality education it provided. Its faculty, known for their domain area expertise and excellence in teaching, competed with each other for a better student feedback. Of late, the institute was finding it difficult to upgrade its course content with rapidly changing global business scenario. The difficulties multiplied when the school realized that some of senior faculty would retire on regular basis, starting in the near future. To overcome these difficulties, BBS decided to recruit young faculty in all the departments (e.g., Economics, Finance, Marketing, HRM, Production etc).</span></p><p><span style=\"color: rgb(51, 51, 51);\">When the Dean - Academics scanned the applications, she found three distinct types of aspirants viz. (i) A type candidates who were very good teachers, competent at teaching the courses taught by existing faculty members; (ii) B type candidates who were average teachers, competent at creating and teaching new courses that would complement existing courses, taught by the current faculty; (iii) C type candidates were not-so-good teachers, willing to teach any course BBS required.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Note1: A course is termed complementary when it covers latest content and complements existing courses offered by a department.</span></p><p><span style=\"color: rgb(51, 51, 51);\">Note2: Each department decides the suite of courses to be offered.</span></p>",
