                        "question": "<p><strong style=\"color: rgb(51, 51, 51);\">The expected time to prepare the dish is the weighted average of optimistic, pessimistic and most likely time.</strong></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">Which of the following is the expected wait time for the chef to communicate to the customers?</strong></p>",
