                        "question": "<p><strong style=\"color: rgb(51, 51, 51);\">The following arguments were presented to Arti about the candidates with vision impairment:</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">1.Visually impaired can do some activities better than the normal people and hence complement other employees.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">2.Visually impaired can motivate other employees to work harder.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">3. Visually impaired can act as a role model for other disadvantaged people in the society</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">4. Visually impaired can work harder to prove themselves</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">5. Hiring visually impaired people may enhance organizational reputation which may consequently lead to better sales.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">6. Visually impaired have to be paid 20 percent extra salary.</strong></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">From the above arguments, which of the following options indicate that CEO’s apprehensions are misplaced?</strong></p>",
