                        "question_type": 1,
                        "context": "<p><strong style=\"color: rgb(51, 51, 51);\">Read the following scenario and answer the THREE questions that follow.</strong></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Arti, CEO of an FMCG company, was under pressure from the Board of Governors (BoG) to increase diversity in the workforce. The board wanted the company to hire candidates with vision impairment*, as it believed that they contributed to organizations in many unique ways.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">The CEO was apprehensive of hiring visually impaired candidates; she was not sure about the feasibility of accommodating them in the current setting. Moreover, Arti was unsure as to how the visually impaired could contribute meaningfully to the organization.</span></p><p><span style=\"color: rgb(51, 51, 51);\">(* A person, with a vision impairment in a range of 60-100 percent, is referred to as a visually impaired person. A person with 100 percent vision impairment cannot see at all.)</span></p>",
