                        "question": "<p><strong style=\"color: rgb(51, 51, 51);\">Arti wanted to follow the suggestion given by the Board of Governors; however, she was not sure if the company was ready to accommodate candidates with 100 percent visual impairment. Also, the concern of involving such employees in meaningful activities was constantly bothering her. Hence, she constituted a committee to come up with recommendations that would help the company in hiring 100 percent visually impaired employees</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">After two months of deliberations, the committee came up with the following recommendations:</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">1. Hire visually impaired employees unconditionally as it is any company’s social responsibility</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">2. Hire visually impaired employees in the activities they can contribute</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">3. Ensure visually impaired friendly office space, food courts, restrooms, parking etc.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">4. Allow guide dogs to assist employees with 100 percent vision impairment in the office premises</strong></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">Which of the following options will BEST allay concerns as well as be fair to all stakeholders?</strong></p>",
