                        "question": "<p><strong style=\"color: rgb(51, 51, 51);\">The CEO of Fair Consulting wanted the adjudicating committee to reduce the number of errors while deciding on sexual harassment complaints. The employees suggested that the committee could do the following to reduce errors in judgment.</strong></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">1. Listen to the arguments of both the complainant and the accused together</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">2. Listen to the arguments of both the complainant and the accused separately</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">3. Involve a member of women’s commission</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">4. Take the help of a retired judge</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">5. Hire a forensic expert to verify evidences</strong></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">From the following, choose the MOST effective sequence that would help the committee to arrive at the right decision.</strong></p>",
