                        "difficulty_level_manual": "medium",
                        "question": "<p><strong style=\"color: rgb(51, 51, 51);\">Of late, the adjudicating committee received a complaint from a junior female consultant. Her immediate boss cracked a bawdy joke about her in the office tuck shop. When the committee probed the alleged misconduct, they identified an independent witness. She agreed to give her testimony to the committee: however, she was unsure if she would like to be identified either by the complainant or the accused. The convenor of the committee was confused about the stance to be taken on the witness’s concern.</strong></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">Which of the following will be the BEST stance to be taken by the convenor?</strong></p>",
