                        "difficulty_level_manual": "medium",
                        "question": "<p><strong style=\"color: rgb(51, 51, 51);\">Mr. Q is an IT professional who works for a small company in Bangalore. His office hours are from 2:00 p.m. to 10:00 p.m.; thus, he wants to utilize his morning time. He thought of taking up extra work; however, he is not sure about the righteousness of his decision. His company does not have any clear policy on Moonlighting. As he is confused, he seeks opinions of the people who work in his industry to understand ethical dimension of Moonlighting. The following opinions are shared with Mr. Q:</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">Opinion 1: Moonlighting is unacceptable since the employer has a complete right over the employee.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">Opinion 2: Moonlighting is a choice of the employee, and that the employer has no authority over the employee's conduct after office hours.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">Opinion 3: Moonlighting leads to employee missing out on important organizational work.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">Opinion 4: While Moonlighting, the employee might unknowingly leak critical information gained from one organization to the other.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">Opinion 5: It is OK to Moonlight as employers are exploitative and underpay employees.</strong></p><p><strong style=\"color: rgb(51, 51, 51);\">Given the abovementioned opinions, which of the following combinations will BEST help Mr. Q to realize that Moonlighting is unethical?</strong></p>",
